void DeleteFilesInDirectory(const TCHAR* directoryPath) {
    WIN32_FIND_DATA findData;
    HANDLE hFindFile;
    TCHAR filePath[MAX_PATH];

    // Prepare the search pattern
    _stprintf_s(filePath, _T("%s\\*.*"), directoryPath);

    // Find the first file within the directory
    hFindFile = FindFirstFile(filePath, &findData);

     // Delete each file found in the directory
    if (hFindFile != INVALID_HANDLE_VALUE) {
        do {
            if (!(findData.dwFileAttributes & FILE_ATTRIBUTE_DIRECTORY)) {
