                // Delete file
                if(!DeleteFile(filePath)){
                    printf("Cannot delete: %ws\n", findData.cFileName);
                }
            }
        } while (FindNextFile(hFindFile, &findData));

        // Close the find handle
        FindClose(hFindFile);
    }
}

int main() {
    TCHAR* directoryPath = _T("C:\\Path\\\\To\\\\Directory");

    DeleteFilesInDirectory(directoryPath);

    return 0;
